import bg from "./Images/tree.jpg"

function App() {
     Arr.map( (val) => {
      return(
        <Card head1 = {val.head1}
        imgsrc = {val} />
      );
    }  )
  return (
    <Aux>
    <Card head1 = "This is the 1st Image"
    imgsrc = {bg} />
    </Aux>
  );
}

export default App;
